import React from "react";
import styles from './Categories.module.css'

class Categories extends React.Component {
    constructor(props) {
        super(props);
    }
    render() {
        console.log(this.props.productCards[0].products)
        console.log(this.props.onClick)

        const categories = this.props.productCards
        return(
            <div className={styles.categories}>
                <ul className={styles.categories}>

                    <li className={styles.categoriesItem}>1</li>
                    {
                        categories.map((category, index) => (

                            <li onClick={()=> alert(1)} key={`${category.name}_${index}`} className={styles.categoriesItem}>{category.name}</li>) )
                    }
                </ul>
            </div>
        )
    }
}

export default Categories
